import axios from 'axios';
import { API_URL } from '../config';

export const admissionScoreService = {
  getAll: (params = {}) => {
    return axios.get(`${API_URL}/admission-scores`, { params });
  },

  getByUniversity: (universityId) => {
    return axios.get(`${API_URL}/admission-scores/university/${universityId}`);
  },

  getByMajor: (majorId) => {
    return axios.get(`${API_URL}/admission-scores/major/${majorId}`);
  }
};
